def pytoPlot():

    root = Tk()
    root.title("Welcome")

    def select(choice):

        if choice=="yes":
            root.withdraw()
            message_window.destroy()
            plot()

        else:
            root.withdraw()
            message_window.destroy()
            plot_differences()

    def new():
        global message_window
        message_window = Toplevel()
        message_window.title("Choose your plot")
        label = Label(message_window, text="What do you want to plot? \U0001F914",
                      font=("ariel 22 bold"), justify=LEFT)
        label.pack(padx=20, pady=15)
        no = Button(message_window, text="Difference Plot", font=("ariel 15 bold"), width=8, relief=GROOVE,
                    bd=3, command=lambda: select("no"))
        no.pack(padx=5, pady=10, side=RIGHT)
        yes = Button(message_window, text="Single Plot", font=("ariel 15 bold"), width=8, relief=GROOVE,
                     bd=3, command=lambda: select("yes"))
        yes.pack(pady=10, side=RIGHT)





    text = Label(root, text="Click \"Start\" to begin", font=("ariel 20 bold"))
    text.pack(padx=30, pady=5,side=TOP)
    new = Button(root, text="Start", font=("ariel 20 bold"), width=10,
                        relief=GROOVE, bd=2, bg='black',fg="orange", command=new)
    new.pack(padx=30, pady=15)
    root.mainloop()


