def export_plot(x):
    
    tipo = x
    
    display.display(print_export())
    
    time.sleep(2) 
    
    Tk().withdraw()
    dir_name = askdirectory()
    path = os.path.join(dir_name,'figure_' + tipo + '_' + time.strftime("%Y-%m-%d_%H%M%S") + '.jpg')
