def plot_scalar(x,p): 
    
    factor = 0.529177249
    
    tipo = x
    path = p
    
    l_dens=[]
    with open(path, 'r') as f_dens:
        for i in f_dens:
            l_dens.append(i)
    
    n_punti_x = int(l_dens[1].strip().split()[0])
    n_punti_y = int(l_dens[1].strip().split()[1])
    
    x_min = float(l_dens[2].strip().split()[0]) * factor
    x_max = float(l_dens[2].strip().split()[1]) * factor
    x_step = float(l_dens[2].strip().split()[2]) * factor
    
    y_min = float(l_dens[3].strip().split()[0]) * factor
    y_max = float(l_dens[3].strip().split()[1]) * factor
    y_step = float(l_dens[3].strip().split()[2]) * factor
    
    l_dens = l_dens[5:]
    
    m_dens=[]
    for i in l_dens:
        m_dens.append(re.sub("\s\s+" , " ", i))
        
    n_dens=[]
    for i in m_dens:
        n_dens.append(i.replace('\n','').split())
    
    df = pd.DataFrame(n_dens)
    
    for i in range(0,8):
        df[i] = df[i].astype(float)
        
    flat_list = [item for sublist in df.values for item in sublist]
    
    cleaned_list = [x for x in flat_list if ~np.isnan(x)]
    
    l = [cleaned_list[x:x+n_punti_x] for x in range(0, len(cleaned_list),n_punti_x)]
    
    x = np.linspace(x_min,x_max,n_punti_x)
    y = np.linspace(y_min,y_max,n_punti_y)
    
    a = x_max - x_min
    b = y_max - y_min
    r = a/b


    c = 10
    d = 10 / r
    
    
    ctr1 = np.array([0.002,0.004,0.008,0.02,0.04,0.08,0.2,0.4,0.8,2,4,8,20])
    colors1 = ['r','r','r','r','r','r','r','r','r','r','r','r','r']
    ls1 = ['-','-','-','-','-','-','-','-','-','-','-','-','-']
    
    ctr2 = np.array([-8,-4,-2,-0.8,-0.4,-0.2,-0.08,-0.04,-0.02,-0.008,-0.004,-0.002,0.002,0.004,0.008,0.02,0.04,0.08,
                 0.2,0.4,0.8,2,4,8])
    colors2 = ['b','b','b','b','b','b','b','b','b','b','b','b','r','r','r','r','r','r','r','r','r','r','r','r']
    ls2 = ['--','--','--','--','--','--','--','--','--','--','--','--','-','-','-','-','-','-','-','-','-','-','-','-']
    
    ctr3 = np.array([0,0.05,0.10,0.15,0.20,0.25,0.30,0.35,0.40,0.45,0.50,0.55,0.60,0.65,0.70,0.75,0.80,0.85,0.90,
                     0.95,1])
    colors3 = ['k','b','b','b','b','b','b','b','b','b','b','r','r','r','r','r','r','r','r','r','r']
    ls3 = ['dotted','--','--','--','--','--','--','--','--','--','--','-','-','-','-','-','-','-','-','-','-']
    
    
    if (tipo == 'SURFRHOO') or (tipo == 'SURFGRHO') or (tipo == 'SURFGKIN'):
        levels = ctr1
        colors = colors1
        linestyles = ls1
        fmt = '%1.3f'
    elif (tipo == 'SURFLAPP') or (tipo == 'SURFLAPM') or (tipo == 'SURFVIRI') or (tipo == 'SURFKKIN'):
        levels = ctr2
        colors = colors2
        linestyles = ls2
        fmt = '%1.3f'
    elif (tipo == 'SURFELFB'):
        levels = ctr3
        colors = colors3
        linestyles = ls3
        fmt = '%1.2f'
    
    plt.rcParams["figure.figsize"] = [c,d]
    
    plt.xlabel(r'$\AA$',fontsize=18)
    plt.ylabel(r'$\AA$',fontsize=18)

    X,Y = np.meshgrid(x,y) 
    
    #Change here to have or not the isovalues on the plot
    iso = True
    #iso = False
    
    if (iso == True):
        L = plt.contour(X, Y, l, levels = levels, colors = colors, linestyles = linestyles, linewidths = 0.7,
                    alpha = 1)
        plt.clabel(L, inline = 1, fontsize = 7, fmt = fmt)
    elif (iso == False):
        L = plt.contour(X, Y, l, levels = levels, colors = colors, linestyles = linestyles, linewidths = 0.7,
                    alpha = 1)
     
    export_plot(tipo)
   
    plt.show()


