def plot_diff(x,p1,p2):    
    
    factor = 0.529177249
    
    tipo = x
    path1 = p1
    path2 = p2
    
    l_dens=[]
    with open(path1, 'r') as f_dens:
        for i in f_dens:
            l_dens.append(i)
            

    l_dens_pato=[]
    with open(path2, 'r') as f_dens_pato:
        for i in f_dens_pato:
            l_dens_pato.append(i)
         

    n_punti_x = int(l_dens[1].strip().split()[0])
    n_punti_y = int(l_dens[1].strip().split()[1])

    x_min = float(l_dens[2].strip().split()[0]) * factor
    x_max = float(l_dens[2].strip().split()[1]) * factor
    x_step = float(l_dens[2].strip().split()[2]) * factor

    y_min = float(l_dens[3].strip().split()[0]) * factor
    y_max = float(l_dens[3].strip().split()[1]) * factor
    y_step = float(l_dens[3].strip().split()[2]) * factor

    l_dens = l_dens[5:]

    m_dens=[]
    for i in l_dens:
        m_dens.append(re.sub("\s\s+" , " ", i))

    n_dens=[]
    for i in m_dens:
        n_dens.append(i.replace('\n','').split())

    df = pd.DataFrame(n_dens)

    for i in range(0,8):
        df[i] = df[i].astype(float)

    l_dens_pato = l_dens_pato[5:]

    m_dens_pato=[]
    for i in l_dens_pato:
        m_dens_pato.append(re.sub("\s\s+" , " ", i))

    n_dens_pato=[]
    for i in m_dens_pato:
        n_dens_pato.append(i.replace('\n','').split())

    df_pato = pd.DataFrame(n_dens_pato)

    for i in range(0,8):
        df_pato[i] = df_pato[i].astype(float)

    df_diff = df - df_pato

    flat_list = [item for sublist in df_diff.values for item in sublist]

    cleaned_list = [x for x in flat_list if ~np.isnan(x)]

    l = [cleaned_list[x:x+n_punti_x] for x in range(0, len(cleaned_list),n_punti_x)]

    x = np.linspace(x_min,x_max,n_punti_x)
    y = np.linspace(y_min,y_max,n_punti_y)


    a = x_max - x_min
    b = y_max - y_min
    r = a/b
    c = 10
    d = 10 / r

    
    ctr1dif = np.array([-8,-4,-2,-0.8,-0.4,-0.2,-0.08,-0.04,-0.02,-0.008,-0.004,-0.002,-0.0008,-0.0004,-0.0002,0,
                       0.0002,0.0004,0.0008,0.002,0.004,0.008,0.02,0.04,0.08,0.2,0.4,0.8,2,4,8])
    colors1dif = ['b','b','b','b','b','b','b','b','b','b','b','b','b','b','b','k','r','r','r','r','r','r','r',
                  'r','r','r','r','r','r','r','r']
    ls1dif = ['--','--','--','--','--','--','--','--','--','--','--','--','--','--','--','dotted','-','-','-','-',
              '-','-','-','-','-','-','-','-','-','-','-']


    levels = ctr1dif
    colors = colors1dif
    linestyles = ls1dif
    fmt = '%1.4f'


    plt.rcParams["figure.figsize"] = [c,d]
    
    plt.xlabel(r'$\AA$',fontsize=18)
    plt.ylabel(r'$\AA$',fontsize=18)

    X,Y = np.meshgrid(x,y) 
    
    #Change here to have or not the isovalues on the plot
    iso = True
    #iso = False

    if (iso == True):
        L = plt.contour(X, Y, l, levels = levels, colors = colors, linestyles = linestyles, linewidths = 0.7,
                    alpha = 1)
        plt.clabel(L, inline = 1, fontsize = 7, fmt = fmt)
        
        #Modify here to place isovalue labales
        #manual_locations = [(-1, -1.4), (-0.62, -0.7), (-2, 0.5), (1.7, 1.2), (2.0, 1.4), (2.4, 1.7)]
        #plt.clabel(L, inline=1, fontsize=10, manual=manual_locations)
    
    elif(iso == False):
        L = plt.contour(X, Y, l, levels = levels, colors = colors, linestyles = linestyles, linewidths = 0.7,
                    alpha = 1)
    
    export_diff_plot(tipo)
    
    plt.show()


