    Tk().withdraw()
    filename_1 = askopenfilename() 
    
    if (filename_1.endswith('SURFRHOO.DAT')) or (filename_1.endswith('SURFLAPP.DAT')) or (filename_1.endswith('SURFLAPM.DAT')) or (filename_1.endswith('SURFELFB.DAT')) :
        pass
    else:        
        display.display(print_duck())
        sys.exit('please choose a SURFRHOO.DAT, SURFLAPP.DAT, SURFLAPM.DAT or SURFELFB.DAT file')
    
    display.display(print_diff())
    
    time.sleep(1) 
        
    filename_2 = askopenfilename()
    
    
    if (filename_2.endswith('.DAT')) :
        pass
    else:
        display.display(print_duck())
        sys.exit('please choose a SURFRHOO_ref.DAT, SURFLAPP_ref.DAT, SURFLAPM_ref.DAT or SURFELFB_ref.DAT file')  
    
    tipo = ''
              
    if (filename_1.endswith('SURFRHOO.DAT')):
        tipo = 'SURFRHOO'
        plot_diff(tipo,filename_1,filename_2)
    elif (filename_1.endswith('SURFLAPP.DAT')):
        tipo = 'SURFLAPP'
        plot_diff(tipo,filename_1,filename_2)
    elif (filename_1.endswith('SURFLAPM.DAT')):
        tipo = 'SURFLAPM'
        plot_diff(tipo,filename_1,filename_2)
    elif (filename_1.endswith('SURFELFB.DAT')):
        tipo = 'SURFELFB'
        plot_diff(tipo,filename_1,filename_2)


